        function bubbleSort(array, compare) {
            for (var j = 0; j < array.length - 1; j++) {
                var isExchange = false;
                for (var i = 0; i < array.length - 1 - j; i++) {
                    if (compare == undefined || !(compare instanceof Function)) {
                        var resultOfCompare = array[i + 1] < array[i];
                    } else {
                        resultOfCompare = compare(array[i + 1], array[i]);
                    }
                    if (resultOfCompare) {
                        var store = array[i];
                        array[i] = array[i + 1];
                        array[i + 1] = store;
                        isExchange = true;
                    }
                }
                if (isExchange) {
                    continue;
                } else {
                    break;
                }
            }
        }

        function quickSort(array, compare) {
            function onceRank(arr, first, last) {
                var store = arr[first];
                var index_front = first;
                var index_after = last;
                if (compare == undefined || !(compare instanceof Function)) {
                    while (index_front < index_after) {
                        while (index_front < index_after) {
                            if (!(arr[index_after] < store)) {
                                index_after--;
                            } else {
                                arr[index_front] = arr[index_after];
                                break;
                            }
                        }
                        while (index_front < index_after) {
                            if (!(store < arr[index_front])) {
                                index_front++;
                            } else {
                                arr[index_after] = arr[index_front];
                                break;
                            }
                        }
                    }
                } else {
                    while (index_front < index_after) {
                        while (index_front < index_after) {
                            var resultOfCompare = compare(arr[index_after], store);
                            if (!(resultOfCompare)) {
                                index_after--;
                            } else {
                                arr[index_front] = arr[index_after];
                                break;
                            }
                        }
                        while (index_front < index_after) {
                            var resultOfCompare = compare(store, arr[index_front]);
                            if (!(resultOfCompare)) {
                                index_front++;
                            } else {
                                arr[index_after] = arr[index_front];
                                break;
                            }
                        }
                    }
                }
                arr[index_front] = store;
                if (first < index_front - 1) {
                    onceRank(arr, first, index_front - 1);
                }
                if (index_front + 1 < last) {
                    onceRank(arr, index_front + 1, last);
                }
            }

            onceRank(array, 0, array.length - 1);
        }

        function collapseSort(array, compare) {

            collapse(array, 0, Math.floor((array.length - 1) / 2), array.length - 1);

            function collapse(array, front, middle, behind) {
                if (front < middle) {
                    collapse(array, front, Math.floor((front + middle) / 2), middle);
                }
                if (middle + 1 < behind) {
                    collapse(array, middle + 1, Math.floor((middle + 1 + behind) / 2), behind);
                }

                var arr_left = [];
                var arr_right = [];
                for (var index = front; index <= middle; index++) {
                    arr_left.push(array[index]);
                }
                for (var index = middle + 1; index <= behind; index++) {
                    arr_right.push(array[index]);
                }

                var index = front;
                if (compare === undefined || !(compare instanceof Function)){
                    while (arr_left.length && arr_right.length) {
                        array[index] = arr_left[0] < arr_right[0] ? arr_left.shift() : arr_right.shift();
                        index++;
                    }
                }else{
                    while (arr_left.length && arr_right.length) {
                        array[index] = compare(arr_left[0], arr_right[0]) ? arr_left.shift() : arr_right.shift();
                        index++;
                    }
                }
                if (arr_left.length == 0) {
                    while (arr_right.length > 0) {
                        array[index] = arr_right.shift();
                        index++;
                    }
                } else {
                    while (arr_left.length > 0) {
                        array[index] = arr_left.shift();
                        index++;
                    }
                }
            }
        }

        function heapSort(array, compare) {
            var heap = [null];
            for(var index = 0 ; index < array.length ; index++){
                heap.push(array[index]);
            }
            for(var index = Math.floor((heap.length - 1) / 2) ; index > 0 ; index--){
                moveDown(heap, index);
            }
            for(var index = 0; heap.length > 1 ; index++){
                array[index] = heap[1];
                heap[1] = heap[heap.length - 1];
                heap.length = heap.length - 1;

                moveDown(heap, 1);
            }


            function moveDown(arr, index) {
                if((index * 2) >= arr.length){
                    return;
                }
                var compare_left = true;
                var exchange = arr[index];
                if((index * 2 + 1) < arr.length){
                    compare_left =  compare(arr[index * 2], arr[index * 2 + 1]);
                }
                if(compare_left){
                    if(!compare(arr[index], arr[index * 2])){
                        arr[index] = arr[index * 2];
                        arr[index * 2] = exchange;
                        moveDown(arr, index * 2);
                    }
                }else{
                    if(!compare(arr[index], arr[index * 2 + 1])){
                        arr[index] = arr[index * 2 + 1];
                        arr[index * 2 + 1] = exchange;
                        moveDown(arr, index * 2 + 1);
                    }
                }
            }
        }

        function compare(left, right) {
            return left < right;
